import React from 'react'
import {
    Box, Heading
} from '@chakra-ui/react'
import OverviewMain from './main_overview'


function Overview(props){
    return(
        <Box>
            <Heading
            color="hsl(228, 12%, 44%)"
            fontWeight="black"
            fontSize="xl"
            mb={5}
            >Overview - Today</Heading>
            <OverviewMain dataItems={props.dataItems}/>
        </Box>
    )
}

export default Overview
